css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("userstyles.org") {


@font-face {
    font-family: "Whitney SSm A";
    font-style: normal;
    font-weight: 400;
    src: url("data:application/x-font-woff;base64,");
}
@font-face {
    font-family: "Whitney SSm B";
    font-style: normal;
    font-weight: 400;
    src: url("data:application/x-font-woff;base64,");
}
@font-face {
    font-family: "Whitney SSm A";
    font-style: normal;
    font-weight: 700;
    src: url("data:application/x-font-woff;base64,");
}
@font-face {
    font-family: "Whitney SSm B";
    font-style: normal;
    font-weight: 700;
    src: url("data:application/x-font-woff;base64,");
}
a, body, div, html, input, p {
font-family:"Whitney SSm A", "Whitney SSm B", Helvetica, Arial, sans-serif!important
}
body {
line-height:1.5
}
#left-sidebar {
width:250px
}
#main-article {
margin-left:280px
}
#left-sidebar .ad {
background-color:#eeeed2
}
#main-header {
background-color:#d1eeee;
font-family:"Whitney SSm A", "Whitney SSm B", Helvetica, Arial, sans-serif!important;
padding:15px;
text-align:center
}
#main-header>h1 {
font-weight:700!important
}
#left-sidebar>* {
padding:20px
}
#search-terms {
border:1px solid #224375;
border-radius:2px 0 0 2px;
color:#224375;
float:left;
font-size:13px;
height:28px;
padding:0;
text-indent:5px;
width:165px
}
#search-submit {
background:#224375;
border:none;
border-radius:0 2px 2px 0;
color:#fff;
float:left;
height:30px;
margin-left:0;
margin-right:0;
padding-left:1px;
padding-right:1px;
width:33px
}
#show-advanced-search {
margin-top:4px;
font-size:11px
}
#left-sidebar #sidebar-browse {
float:left;
margin-top:2px
}
#left-sidebar li {
clear:both;
display:block;
margin-bottom:2px
}
#left-sidebar li a {
display:block;
font-size:12px;
padding:2px 0;
text-decoration:none
}
#front-page-best li, #front-page-newest li {
margin-bottom:8px
}
#front-page-best li a, #front-page-newest li a {
text-decoration:none
}
#front-page-best li a:hover, #front-page-newest li a:hover {
text-decoration:underline
}
#front-page-best ul, #front-page-newest ul {
padding-left:15px
}
input[type=email], input[type=password], input[type=text], input[type=url], textarea, #login-existing {
border:1px solid #224375;
border-radius:2px;
color:#224375;
font-size:13px;
padding:10px;
-webkit-box-sizing:border-box;
-moz-box-sizing:border-box;
box-sizing:border-box
}
#advanced-search {
font-size:11px;
margin-top:3px
}
#advanced-search select {
border:1px solid #224375;
font-size:12px;
margin:0 0 3px;
padding:5px;
width:96%
}
#advanced-search-submit {
margin-top:5px;
text-align:left
}
#advanced-search-submit button, #advanced-search-submit input[type="submit"] {
background:#224375;
border:medium none;
border-radius:2px;
color:#fff;
font-family:"Whitney SSm A", "Whitney SSm B", Helvetica, Arial, sans-serif!important;
font-weight:700;
height:32px;
margin-right:3px;
padding:6px 10px;
text-transform:uppercase;
cursor:pointer
}
input[type="submit"], input[type="button"] {
background:none repeat scroll 0 0 #224375;
border:medium none;
border-radius:3px;
color:#fff;
cursor:pointer;
font-family:"Whitney SSm A", "Whitney SSm B", Helvetica, Arial, sans-serif!important;
font-size:12px;
font-weight:700;
margin-bottom:4px;
padding:6px;
text-transform:uppercase
}
.linking-note {
font-size:11px;
font-style:normal
}
input[type="submit"]:hover, input[type="button"]:hover {
background:#152c50!important
}
}
